import React from 'react';

interface PostProps {
  post: {
    id: string;
    content: string;
    likes: number;
  };
  onLike: (postId: string) => void;
}

const Post: React.FC<PostProps> = ({ post, onLike }) => {
  return (
    <div>
      <p>{post.content}</p>
      <button onClick={() => onLike(post.id)}>Like ({post.likes})</button>
    </div>
  );
};

export default Post;
